import { useState } from "react";
import "./index.css";


const App=()=>{

    let date=new Date();

    const [count,setCount]=useState(date.getDate());

    const IncNum=()=>{
        setCount(count+1);
    }
    const DecNum=()=>{
        setCount(count-1)
    }
    const Clear=()=>{
        setCount(0)
    }

    return (
        <>
            <h1>{count}</h1>
            <button onClick={IncNum}>Increment</button>
            <button onClick={DecNum}>Decrement</button>
            <button onClick={Clear}>Clear</button>
        </>
    )
}
export default App;
